БЕСПЛАТНО
Курс для тех, кто хочет зарабатывать от 560 000 рублей в год, продвигая аккаунты компаний в социальных сетях.

С развитием интернет-бизнеса появилось множество новых профессий и SMM-менеджер – одна из них. Продвижение в социальных сетях – один из инструментов, без которого не обходится ни один онлайн-проект, а эксперты этого профиля высоко востребованы на рынке труда. В курсе Профессия: Smm-менеджер»: Основы профессии. Выбор проекта для работы;

Подготовка личного плана по выходу на нужный уровень дохода;

Создание комьюнити в социальной сети и разработка контент-плана;

Существующие методы и технологии продвижения аккаунтов;

Поиск первых заказчиков в интернете.

После того как вы окончите курс и посетите все эфиры, вам будет выдан  ИМЕННОЙ СЕРТИФИКАТ,  который подтвердит получение профессии. Теперь у вас будут все навыки и инструменты для самостоятельного поиска заказчиков и получения своего первого заказа в области SMM.
